import React from "react";

const CapFinder = () => {
  return (
    <div>
      <section className="inner-page-banner-section gradient-bg">
        <div className="illustration-img">
          <img
            src="assets/images/inner-page-banner-illustrations/promotion.png"
            alt="image-illustration"
          />
        </div>
        <div className="container">
          <div className="row">
            <div className="col-lg-6">
              <div className="inner-page-content-area">
                <h2 className="page-title">Find Capital</h2>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default CapFinder;
